import React from "react";
import axios from "axios";
import { BrowserRouter as Router, Route, Routes, useNavigate } from "react-router-dom";
import { Navigation,Home, Contact, SignUp, SignIn, Doctprofile, Logout } from "./components";
class App extends React.Component {

  constructor() {
    super();
    this.state = {
      isauthenticated: false,
      username:'',
      countdrassignment:0,
      countalldoctor:0
    }
    this.getuserauthenticated();
  }


  getuserauthenticated() {
    axios.get("http://localhost:4000/signin", { withCredentials: true })
      .then(res => this.setState({ isauthenticated: res.data.isauthenticated,username:res.data.username,countdrassignment:res.data.countdrassignment}))
      .catch(error => console.log(error));
  }

  componentDidUpdate(prevProps, prevState) {
    if (prevState.isauthenticated !== this.state.isauthenticated) {
      console.log("chan");
    }
  }

  //#region  Routers
  RouterHome() {
    if (true) {
      return (
        <Route exact path="/" element={<Home />} />
      )
    }
  }
  RouterLogout() {
    if (this.state.isauthenticated) {
      return (
        <Route exact path="/logout" element={<Logout/>} />
      )
    }
    else {
      return (
        <Route exact path="/logout" element={<Home />} />
      )
    }
  }
  RouterSignUp() {
    if (!this.state.isauthenticated) {
      return (
        <Route path="/signup" element={<SignUp />} />
      )
    }
    else {
      return (
        <Route path="/signup" element={<Doctprofile />} />
      )
    }
  }
  RouterSignIn() {
    if (!this.state.isauthenticated) {
      return (
        <Route path="/signin" element={<SignIn />} />
      )
    }
    else {
      return (
        <Route path="/signin" element={<Doctprofile />} />
      )
    }
  }
  RouterContact() {
    if (true) {
      return (
        <Route path="/contact" element={<Contact />} />
      )
    }
  }
  RouterDoctprofile() {
    if (this.state.isauthenticated) {
      return (
        <Route path="/doctorNotAPP" element={<Doctprofile isauthenticated={this.state.isauthenticated} />} />
      )
    }
    else {
      return (
        <Route path="/doctorNotAPP" element={<SignIn />} />
      )
    }
  }
  //#endregion

  render() {
    return (
      <div className="App">
        <Router>
          <Navigation countdrassignment={this.state.countdrassignment} isauthenticated={this.state.isauthenticated} username={this.state.username} />
          <Routes>
            {this.RouterHome()}
            {this.RouterSignUp()}
            {this.RouterContact()}
            {this.RouterDoctprofile()}
            {this.RouterSignIn()}
            {this.RouterLogout()}
          </Routes>
        </Router>
      </div>
    );
  }
}
export default App;
